Invokasyon Obligatoria del Meldador

Al silensyo divino de la infinitud inalkansavle;
Al silensyo divino del saver perfeksionado;
Al silensyo divino de la boz sin sonido;
Al silensyo divino del Korasón del Laberinto;
Al silensyo divino de la mente antiguada;
Al silensyo divino del gía no nasido;
Al silensyo divino del gía invisivle, protektor de toda kriatura bivyente;
Al silensyo divino de los ke alkansaron la perfeksión del saver;
Al silensyo divino de la enkarnasyon umana;
Al silensyo divino de los gías del laberinto ke sakrifikan su liberasyon
por akeyos ke aún no despartaron a la verdad;
Al silensyo divino del Señor de la Muerte,
el eterno resitante no nasido del laberinto,
ke sakrifikó su propia redempsión
por la redempsión de todos los viajantes;
Al silensyo divino del ser primordyial;
Al silensyo divino del grande sakrifisio;
Ofrendamos omenaje, amor, i esperansa;
Ma sovre todo, damos muestra gratitud.

Afrontando la Luz Klara

Agora esto eksperyensyando la Luz Klara de la realidad objektiva.
Nada esta pasando, nada djamas pasó ni djamas pasará.
Mi sensasyon presente del mizmo, el viajante, es en realidad el vazyío mizmo, sin kualidades ni karakterístikas.
Me akodro a mí mizmo komo el viajante, ken la más profunda natura es la Luz Klara mizma; so uno; no ay otro.
So el vazyío del vazyío, el eterno no nasido, no kriado,
ni real ni irreal.
Todo lo ke fuy konsyente es mi propia djugadera de konsyensya,
una dansa de luz,
figuras vortiyantes de luz en ekstensión infinita,
inkavavle infinitud,
el Absoluto más ayá del kambio, de la egzistensya, de la realidad.
Yo, el viajante, so inseparavle de la Luz Klara;
No puedo naser, morir, egzistir, o trokar.
Ahora sé ke esta es mi verdadera natura.
